Everything you never knew about space!
Amazing Space Q&amp;A explores the final frontier, from cosmic dust to super giant stars. Bursting with eye-opening questions and revealing answers, the book tells tell you everything you ever wanted to know about the universe (but were afraid to ask!).

About the Author
Dr. Mike Goldsmith has a Ph.D. in astrophysics and studies the philosophy of time and space. He is the head of acoustics at the United Kingdom's National Physical Laboratory. An author of more than twenty nonfiction books for children, he was nominated for the Aventis Prize for Science, Junior Section.
